// 注册蓝牙库
sdk.ble.addBleDelegate(api: )
sdk.ble.bluetoothRegister(heartPingSecond: 5, outputToConsole: false)
sdk.ble.getBluetoothState { [weak self] stateModel in
    // 状态监听
}

