获取是否支持v3运动数据交换 
status
交换数据状态
方法
appExec(type:)
app执行数据交换

Parameters:
type: app执行数据交换实体 IDOAppExecType



appReplyExec(type:)
ble发起运动 ble执行数据交换 app回复

Parameters:
type: app回复数据实体 IDOAppReplyType



