        }

              // APP提供设备绑定状态, 设备蓝牙连接时会调用该方法，如何返回true，将会走快速配置（获取设备功能表、设备信息、三级版本号、更新手表时间等）
              override fun checkDeviceBindState(macAddress: String): Boolean {
            return bindState()

